import React from 'react';
import {Grid, Typography, makeStyles, Paper, Avatar, Table, TableBody, TableCell, TableRow,IconButton, Button} from '@material-ui/core';
import EditIcon from '@material-ui/icons/Edit';

const useStyles = makeStyles((theme: any)=>({
    root : {
        width : '100%',
        height : '91vh'
    },
    displayFlex : {
        padding :theme.spacing(10),
        display : 'flex',
        justifyContent : 'center',
        alignItems : 'center',
        height : '100%'
    },
    spaceEvenly : {
        display : 'flex',
        flexDirection : 'column',
        justifyContent : 'space-evenly',
        alignItems : 'center',
        height : '100%',
        width : '80%',
        margin:'auto'
    },
    paperStyle : {
        width : '100%',
        height : '100%'
    },
    avatharStyle : {
        width : theme.spacing(20),
        height : theme.spacing(20)
    },
    themeButton: {
        color: theme.palette.white,
        backgroundColor: theme.palette.green.main,
        '&:hover': {
          backgroundColor: theme.palette.green.dark,
        },
    },
}))

function AdminProfileDetails() {
    const classes = useStyles()
    return (
        <div className={classes.root}>
            <div className={classes.displayFlex}>
                <Paper className = {classes.paperStyle}>
                    <div className={classes.spaceEvenly}>
                        <Avatar variant='square' className={classes.avatharStyle} />
                        <Table style={{padding:'20px',width : '65%'}}>
                            <TableBody>
                            <TableRow >
                                <TableCell align = 'center'>Name</TableCell>
                                <TableCell align = 'center'>SomeName</TableCell>
                                <TableCell align = 'center'><IconButton className={classes.themeButton}><EditIcon /></IconButton></TableCell>
                            </TableRow>
                            <TableRow >
                                <TableCell align = 'center'>Email</TableCell>
                                <TableCell align = 'center'>SomeName@123.com</TableCell>
                                <TableCell align = 'center'></TableCell>
                            </TableRow>
                            <TableRow >
                                <TableCell align = 'center'>Admin Type</TableCell>
                                <TableCell align = 'center'>Nutritionist</TableCell>
                                <TableCell align = 'center'></TableCell>
                            </TableRow>
                            <TableRow >
                                <TableCell align = 'center'>Password</TableCell>
                                <TableCell align = 'center'>**********</TableCell>
                                <TableCell align = 'center'><Button className={classes.themeButton}>ChangePassword</Button></TableCell>
                            </TableRow>
                            </TableBody>
                        </Table>
                    </div>
                </Paper>
            </div>
        </div>
    )
}

export default AdminProfileDetails
